import Shell from "./Shell";
import { Container, CardContent, useTheme, TextField } from "@mui/material";

function Business() {
  const theme = useTheme();

  const properties = (theme) => ({
    businessContainer: {
      component: "div",
      id: "name",
    },
    email: {
      id: "email",
      type: "email",
      label: "email",
      required: true,
    },
    firstName: {
      id: "first name",
      type: "text",
      label: "first",
      required: true,
    },
    lastName: {
      id: "last name",
      type: "text",
      label: "last",
      required: true,
    },
  });

  const styles = (theme) => ({
    cardContent: {
      display: "flex",
      flexDirection: "column",

      [theme.breakpoints.up("md")]: {
        justifyContent: "center",
      },
    },
    nameContainer: {
      marginBottom: "2rem",
      display: "flex",
      flexDirection: "column",
      [theme.breakpoints.up("sm")]: {
        flexDirection: "row",
      },
    },
    firstName: {
      [theme.breakpoints.down("sm")]: {
        marginBottom: "1rem",
      },
      [theme.breakpoints.up("sm")]: {
        marginRight: "1rem",
      },
    },
    lastName: {
      [theme.breakpoints.down("sm")]: {
        marginTop: "1rem",
      },
      [theme.breakpoints.up("sm")]: {
        marginLeft: "1rem",
      },
    },
    email: {
      width: "100%",
    },
  });

  return (
    <Shell
      heading="Business Information"
      index={2}
      content={
        <CardContent sx={styles(theme).cardContent}>
          <Container
            sx={styles(theme).businessContainer}
            {...properties.nameContainer}
          >
            <TextField
              {...properties(theme).businessName}
              sx={styles(theme).businessName}
            />
          </Container>
          <Container>
            <TextField {...properties(theme).email} sx={styles(theme).email} />
          </Container>
        </CardContent>
      }
      //   subheading="Click the button below to get started"
      // content={<TextField id="time" type="time" inputProps={inputProps} />}
    />
  );
}

export default Business;
